const playAt=(t,e)=>location.href=`/watch/${e}?list=${t}`,renameList=async t=>{await fetch(`/api/list/${t}/rename`,{method:"post",headers:{"Content-Type":"application/json"},body:JSON.stringify({name:prompt("Playlist name:","Untitled")})}),location.reload()},deleteList=async t=>{await fetch(`/api/list/${t}/delete`,{method:"post"}),location.reload()};document.addEventListener("DOMContentLoaded",(function(){document.querySelectorAll('[list][action="play"]').forEach((t=>t.addEventListener("click",(()=>{return e=t.getAttribute("list"),i=t.getAttribute("at"),location.href=`/watch/${i}?list=${e}`;var e,i})))),document.querySelectorAll('[list][action="delete"]').forEach((t=>t.addEventListener("click",(()=>deleteList(t.getAttribute("list")))))),document.querySelectorAll('[list][action="rename"]').forEach((t=>t.addEventListener("click",(()=>renameList(t.getAttribute("list"))))))}));